import React, {useState} from "react";
import "./List.css";
import * as restaurantData from "./data/restaurant.json";
import Card from "./Card";

const List = props => {

    const clickOnRestaurant = () => {
        <div key={props.restaurant.restaurantID} className="itemList" onClick= {() => {
            clickRestaurant(props.restaurant);
            }}>
        </div>
    }

    return(restaurantData ?
        <ul className="list">
            {restaurantData.features.map(restaurant => (
                <Card display={true} displayDetails={false} restaurant={restaurant} idRestaurant={restaurant.restaurantID}/>
            ))}
        </ul>
    : <div>Chargement du restaurant...</div>);
}

export default List;
